scriptlet.script:
if(scriptletInput != null && scriptletInput != undefined) {
	var ca = JSON.parse(scriptletInput);
	scriptletResult = ca.publicKey;
}
else {
	scriptletResult = "";
}

if(scriptletInput != null && scriptletInput != undefined) {
	var ca = JSON.parse(scriptletInput);
	scriptletResult = ca.ipAddress;
}
else {
	scriptletResult = "";
}

if(scriptletInput != null && scriptletInput != undefined) {
	var ca = JSON.parse(scriptletInput);
	scriptletResult = ca.hostName;
}
else {
	scriptletResult = "";
}

